---- get payments for privileged customers
select distinct ap.payment_date::DATE ,
      count(distinct ap.payg_account_id),
      round(sum(ap.amount),0)
from
      src_odoo13_kenya.account_payment ap 
where 
      ap.state = 'posted'
      and ap.payment_status = 'matched'
      and ap."type" = 'mobile'
